import styled from 'styled-components';


export const NavigationBar = styled.nav`
  font-family: 'Lato', sans-serif;
  display: flex;
  justify-content: flex-end;
  width: 100%;
  height: 20%;

    .home {
      position: absolute;
      font-size: 2em;
      color: white;
      width: 207px; 
      height: 25px; 
      left: 11%;  
      z-index: 200;   
    }

    .uList {
      display: flex;
      align-items: baseline;
      justify-content: space-between ;
      height: 15%;
      width: 50%;
      padding-right: 128px;
    
        .login-out {
          position: absolute;
          right:15%;
          z-index: 300;
          font-size: 15px;
          list-style: none;
          color: white;
          padding: 23.5px;
        }

        .how-works {
          position: absolute;
          right: 24%;
          z-index: 300;
          font-size: 15px;
          list-style: none;
          color: white;
          padding: 23.5px;
        }

        .trials {
          position: absolute;
          right: 50%;
          z-index: 300;
          font-size: 15px;
          list-style: none;
          color: white;
          padding: 23.5px;
        }
        
        img {
          margin: 3.5% 0;
          width: 24px;
          height: 26px;
        }
        
    }

  
  }  
`;
